import React from 'react';
import { MDBBtn, MDBContainer } from 'mdb-react-ui-kit';
import Dropdown from "./component/dropdown"
import Headers from "./component/"

function App() {
  return (
    <MDBContainer fluid>
      <Headers />
      <Dropdown />
    </MDBContainer>
  );
}

export default App;
